$(document).ready(function(){$(document).on("click",".faq .filter .btn",function(){var a=$(this).data("filter");$(".faq .filter .btn").addClass("btn-default").removeClass("btn-primary");$(this).addClass("btn-primary").removeClass("btn-default");$(".faq").find(".panel-group .item .panel-heading").find("a").addClass("collapsed");$(".faq").find(".panel-group .item .panel-body").parent().removeClass("in");if(a==""){$(".faq").find(".panel-group").find(".item").show()}else{$(".faq").find(".panel-group").find(".item").hide();$(".faq").find(".panel-group").find(".item.filter"+a).show()}})});